css:
@-moz-document domain("compresspng.com"), domain("compressjpeg.com"), domain("shrinkpdf.com"), domain("png2jpg.com"), domain("jpg2png.com"), domain("svgtopng.com") {
html, body,
#carousel .ui-state-default
{
    background-color: #333;
}

#main, #carousel-wrapper
{
    background: #444;        
}

#carousel-prev-wrapper, #carousel-next-wrapper {
    background-color: #444;        
}

html, body,
span,
#like-it
{
    color: #ccc;
}

#header-left {
    float: unset;
    width: unset;
    position: unset;
}
 
#header-right{
    display: none;
}

#carousel .ui-state-default {
    border: none;
}
}
